from stw_py_api_runtime.gen_classes.types.enum_type import EnumType
from stw_py_api_runtime.gen_shared_types.basic_types import *


class Error(EnumType):
    """None"""

    @classmethod
    def _base_type(cls):
        return uint8_t

    # много параметров для команды
    CmdParamTooMany = 0
    # недостаточно параметров для команды
    CmdNotEnoughData = 1
    # некорректные параметры команды
    CmdBadArg = 2
    # неизвестное тм-сообщение
    TmUnknown = 3
    # не реализовано
    NotImplemented = 4
    # недостаточно памяти
    NotEnoughMemory = 5
    # некорректная склейка бубен-сообщения
    NonEmptyOnShort = 6
    # некорректная первая часть длинного сообщения
    BadFirst = 7
    # присутствует начало сообщения на фоне нового
    EmptyOnFirst = 8
    # слишкомдлинное сообщение
    MsgTooBig = 9
    # присутствует середина сообщения на фоне нового
    MiddleOnEmpty = 10
    # присутствует середина сообщения на фоне короткого
    MiddleOnShortOrLast = 11
    # недостаточно памяти для склейки сообщения
    MiddleExceedsSize = 12
    # пришел конец а сообщения нет
    LastOnEmpty = 13
    # пришел конец а там короткое
    LastOnShort = 14
    # некорректный размер последнего куска
    BadLastSize = 15
    # некорректное crc
    BadCrc = 16
    # некорректный размер в буфере
    BadSizeInBuf = 17
    # некорректный размер в буфере2
    BadSizeInBuf2 = 18
    # присутствует начало сообщения на фоне нового
    ShortOrFirstOnMiddleOrLast = 19
    # пришла середина или конец а начала нет
    MiddleOrLastOnEmpty = 20
    # пригла середина на фоне готового сообщения
    MiddleOnReady = 21
    # предыдущее сообщение испорчено
    PreviousItemIsCorrupted = 22
    # неверный контекст исполнения команды
    CmdBadContext = 23
